import React from 'react';

export default function FilterBar() {
  const categories = ["Top", "Global", "India", "Market", "Karnataka"];

  return (
    <div className="filter-bar">
      {categories.map((category) => (
        <button key={category} className="filter-button">
          {category}
        </button>
      ))}
    </div>
  );
}
